import React, { useState } from 'react';
import "../styles/Search.css";
import { Link } from 'react-router-dom';
import HomeFooter from '../components/HomeFooter';
import DoctorForApproval from '../components/DoctorsForApproval';

function AdminHome() {
  const [message, setMessage] = useState('');


  const handleLogout = async () => {
    try {
        const response = await fetch("http://localhost:8080/doctorlogout", {
        method: 'POST',
        });

        if (response.status === 200) {
        setMessage('Logged out successfully');
        window.location.href = '/patlogin';
        } else if (response.status === 401) {
        setMessage('No user is currently logged in');
        } else {
        setMessage('An error occurred');
        }
    } catch (error) {
        setMessage('An error occurred');
    }
  };
  // Sample doctor data (you can replace it with your own data)
  const doctors = [
    {
      name: 'Dr. John Cruz',
      specialization: 'Cardiologist',
      credentials: 'MD, FACC',
      profilePicture: 'doctor1.jpg',
    },
    {
      name: 'Dr. Jane Smith',
      specialization: 'Dermatologist',
      credentials: 'MD, FAAD',
      profilePicture: 'doctor2.jpg',
    },
    {
        name: 'Dr. David Johnson',
        specialization: 'Pediatrician',
        credentials: 'MD, FAAP',
        profilePicture: 'doctor3.jpg',
      },
      {
        name: 'Dr. Sarah Brown',
        specialization: 'Oncologist',
        credentials: 'MD, FACP',
        profilePicture: 'doctor4.jpg',
      },
      {
        name: 'Dr. Michael Williams',
        specialization: 'Orthopedic Surgeon',
        credentials: 'MD, FAAOS',
        profilePicture: 'doctor5.jpg',
      },
      {
        name: 'Dr. Emily Wilson',
        specialization: 'Gynecologist',
        credentials: 'MD, FACOG',
        profilePicture: 'doctor6.jpg',
      },
      {
        name: 'Dr. Robert Lee',
        specialization: 'Neurologist',
        credentials: 'MD, FAAN',
        profilePicture: 'doctor7.jpg',
      },
      {
        name: 'Dr. Maria Garcia',
        specialization: 'Endocrinologist',
        credentials: 'MD, FACE',
        profilePicture: 'doctor8.jpg',
      },
      {
        name: 'Dr. William Taylor',
        specialization: 'Dentist',
        credentials: 'DMD',
        profilePicture: 'doctor9.jpg',
      },
      {
        name: 'Dr. Jessica Anderson',
        specialization: 'Psychiatrist',
        credentials: 'MD, FAPA',
        profilePicture: 'doctor10.jpg',
      },
  ];

  return (
    <div className="search-container" id="container">
        <div id="navbar">
        <nav>
            <ul>
                <li style={{ float: 'left' }}>
                    <Link to="/">
                    <img
                    src={require('../images/DOC LOGO.png')}
                    alt="Doc Click Connect"
                    style={{ maxWidth: '100px', maxHeight: '40px', marginRight: '20px', marginLeft: '-50px' }}
                    /></Link>
                </li>
                <li style={{ float: 'right' }}>
                <button onClick={handleLogout}>Log Out</button>
                <p>{message}</p>
              </li>
            </ul>
        </nav>
    </div>
      <div className="info-container">
        <div className="doctor-grid">
          {doctors.map((doctor, index) => (
            <DoctorForApproval key={index} doctor={doctor} />
          ))}
        </div>
      </div>
      <HomeFooter />
    </div>
  );
}

export default AdminHome;
